    const [toCart, setToCart] = useState()

    useEffect(() => {
        setToCart(props.sendToCart)
      }, [toCart]);

        const show = () => {
            console.log(toCart)
        }
    return (
        <nav>
            <button onClick={show}>SHOW NAV</button>
            <ul className="navlist">
                <li>Home</li>
                <li>Products</li>
                <li>Contact</li>
                <Cart />
            </ul>
        </nav>
    )
}

export { Nav }
